import React, { useState } from 'react';
import Navbar from './components/Navbar.js';
import Table from './components/Table.js';
import { MDBContainer, } from 'mdb-react-ui-kit';


function Home() {
  return (
    <MDBContainer fluid>
      <Navbar />
      <Table />
    </MDBContainer>
  );
}





function App() {
  return (
    <MDBContainer fluid>
      <Home />
    </MDBContainer>
  );
}

export default App;
